// Navigation.js

import React from "react";
import "./navigation.css";
import { Link } from "react-router-dom";

export const Navigation = () => {
  return (
    <div className="navcontainer">
      <h1>Front office</h1>
      <div className="navigation">
        <Link to="/Apporve">
          <button className="navbutton">APPROVE</button>
        </Link>
        <Link to="/Book">
          <button className="navbutton">BOOK</button>
        </Link>
        <Link to="/ViewAll">
          <button className="navbutton">VIEW ALL</button>
        </Link>
        <Link to="/">
          <button className="navbutton">Logout</button>
        </Link>
      </div>
    </div>
  );
};
